;; @@
(defn key-index [strchar layout] 
  "gets the index of strchar in a particular keyboard layout"
  (first 
    (for [[x keyboard] (map-indexed vector layout) 
          [y row] (map-indexed vector keyboard) 
          [z key] (map-indexed vector row) 
          :when (= key strchar)]
      [x y z])))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;dateparser/key-index</span>","value":"#'dateparser/key-index"}
;; <=

;; @@
(defn max-key-indices [ind layout]
  "given a particular key index, return the bounds
   within a layout that indices can be"
  (let [;_ (prn ind)
         maxkeybords (count layout)
        rows (get-in layout (subvec ind 0 1))
        ;_ (prn rows)
        maxrow (count rows)
        row (get-in layout (subvec ind 0 2))
        ;_ (prn row)
        maxcol (count row)]
    [maxkeybords maxrow maxcol]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;dateparser/max-key-indices</span>","value":"#'dateparser/max-key-indices"}
;; <=

;; @@
(defn keyboard-neighbors [strchar layout]
  (let [ki (key-index strchar layout)
        [mx my mz] (max-key-indices ki layout)
        [kx ky kz] ki
        xs [(- kx 1) kx (+ kx 1)]
        ys [(- ky 1) ky (+ ky 1)]
        zs [(- kz 1) kz (+ kz 1)]]
    (for [x xs
          y ys
          z zs
          :when (and (>= x 0) (< x mx)
                     (>= z 0) (< z mz)
                     (>= y 0) (< y my)
                     (not (and (= x kx) (= y ky) (= z kz))))]
      [x y z])))

