;; @@
(defn charstr-neighborhood [charstr layout]
  "returns characters in neighborhood of
   key with label charstr on a keyboard of a 
   given layout"
  (->>(keyboard-neighbors  charstr layout)
      (map (partial get-in layout))
      (filter #(not= nil %))))
