(defn build-near-key-dists [layout] 
  (let [aks (filter #(not= nil %) (flatten layout))
        background (into [] (zipmap aks (repeat (count aks) 1)))
        ;_ (prn background)
        ]
    (loop [ks aks
           expr {}]
      (if (not (empty? ks))
          (let [k (first ks)
                neighbors (charstr-neighborhood k layout)]
            (recur (rest ks)
                   (conj expr {k (categorical 
                                    (into [] (concat background 
                                            (zipmap neighbors 
                                                   (repeat (count neighbors) 50)))))})))
        expr))))
