(with-primitive-procedures [join miskey]
  (defm randomly-corrupt-string [string]
  (let [num-corruptions (sample (categorical [[1 1000] [2 10][3 1]]))
        ;_ (prn num-corruptions)
        ]
    (loop [n num-corruptions
           s string]
      (if (= 0 n)
        s
        (let [corruption-type (sample (categorical [[:del 1] [:dup 3] [:trans 3]]))
              position (sample (uniform-discrete 0 (count s)))
              ;_ (prn [corruption-type position s])
              ]
          (if (and (= 0 (count s)) (not= corruption-type :ins))
            (recur num-corruptions string)
            (cond 
              (= corruption-type :del) (recur (- n 1) (cond
                                                        (= position 0) (subs s 1) 
                                                        (= position (- (count s) 1)) (subs s 0 (- (count s) 1))
                                                        :else (join [(subs s 0 position) 
                                                                                    (subs s (+ position 1))])))
              (= corruption-type :dup) (recur (- n 1) (join [(subs s 0 position) 
                                                                                           (subs s position (+ 1 position))
                                                                                           (subs s position (+ 1 position)) 
                                                                                           (subs s (+ position 1))]))
              (= corruption-type :trans) (recur (- n 1) 
                                                (cond
                                                  (= position 0) (join [(sample 
                                                                                         (miskey (subs s 0 1)))
                                                                                       (subs s 1)])
                                                  :else (join [(subs s 0 position )
                                                                                    (sample (miskey (subs s position 
                                                                                                           (+ 1 position))))
                                                                                    (subs s (+ position 1))])))))))))))

