(defdist randomstring 
  [l]
  [dist (categorical (zipmap (all-keys macprolayout) (repeat (count (all-keys macprolayout)) 1)))]
  (sample* [this] (join (repeatedly l #(sample* dist))))
  (observe* [this v] (* 10000 (reduce #(+ %1 (observe* dist  (str %2))) 0 v))))
