(with-primitive-procedures [b2i levenshtein-abc-dist randomwhitespacedist randomstring]
  (defquery dateparser [obsdatestr]
    (let [isdate (sample (flip 0.99))

          locale (sample (categorical [[:europe 5] [:usa 5]]))
          year (if (sample (flip 0.1)) 
                 (sample (uniform-discrete -5000 3000))
                 (int (floor (sample (uniform-discrete (- 2017 500) (+ 2017 100))))))
          yearstr (if (sample (flip 0.5)) (mod year 100) year)
          month (sample (uniform-discrete 1 13))
          randomspacing (fn [] (apply str (repeat (sample (categorical [[0 7] [1 2] [2 1]])) " ")))

          leap-year (sample (flip 0.5))
          separator-char (fn [] (sample (categorical [["/" 5] ["-" 2] ["." 2] ["," 5] [" " 5] ["" 3]])))
          
          month-text (cond (= month 1) (sample (categorical [["1" 5] ["Jan" 5] ["Jan." 5] ["JAN" 5] ["JANUARY" 5] ["January" 5]]))
                           (= month 2) (sample (categorical [["2" 5] ["Feb" 5] ["Feb." 5] ["FEB" 5] ["FEBRUARY" 5] ["February" 5]]))
                           (= month 3) (sample (categorical [["3" 5] ["Mar" 5] ["Mar." 5] ["MAR" 5] ["MARCH" 5] ["March" 5]]))
                           (= month 4) (sample (categorical [["4" 5] ["April" 5] ["Apr." 5] ["APR" 5] ["APRIL" 5] ["April" 5]]))
                           (= month 5) (sample (categorical [["5" 5] ["May" 5] ["May." 5] ["MAY" 5]]))
                           (= month 6) (sample (categorical [["6" 5] ["June" 5] ["Jun." 5] ["JUN" 5] ["JUNE" 5] ["June" 5]]))
                           (= month 7) (sample (categorical [["7" 5] ["July" 5] ["Jul." 5] ["JUL" 5] ["JULY" 5] ["July" 5]]))
                           (= month 8) (sample (categorical [["8" 5] ["August" 5] ["Aug." 5] ["AUG" 5] ["AUGUST" 5] ["August" 5]]))
                           (= month 9) (sample (categorical [["9" 5] ["September" 5] ["Sept." 5] ["Sep." 5] ["SEPT" 5] ["SEP" 5] ["SEPTEMBER" 5] ["September" 5]]))
                           (= month 10) (sample (categorical [["10" 5] ["October" 5] ["Oct." 5] ["OCT" 5] ["OCTOBER" 5] ["October" 5]]))
                           (= month 11) (sample (categorical [["11" 5] ["November" 5] ["Nov." 5] ["NOV" 5] ["NOVEMBER" 5] ["November" 5]]))
                           (= month 12) (sample (categorical [["12" 5] ["December" 5] ["Dec." 5] ["DEC" 5] ["DECEMBER" 5] ["December" 5]])))
          
          misspell (sample (flip 0.05))
          
          day (cond
                (contains? [9 4 6 11] month) (sample (uniform-discrete 1 31)) 
                (contains? [2] month) (sample (uniform-discrete 1 (- 30 (b2i leap-year))))
                :else (sample (uniform-discrete 1 32)))
          
          gendatestr (cond 
                       (< year 0) (str (- 0 year) (sample (categorical [["BC" 5] ["bc" 5] ["B.C." 5] ["b.c." 5] ["BC." 5] ["bc." 5]])))
                       (< year 800) (str year (sample (categorical [["AD" 5] ["ad" 5] ["A.D." 5] ["a.d." 5] ["AD." 5] ["ad." 5]])))
                       :else 
                       (cond (= locale :europe) (str day (randomspacing) (separator-char) (randomspacing) month-text (separator-char) (randomspacing) yearstr)
                             :else (str month-text (randomspacing) (separator-char) (randomspacing) day (randomspacing) (separator-char) (randomspacing) yearstr)))
          gendatestr (if misspell (randomly-corrupt-string gendatestr))]

      ;(str obsdatestr " : " gendatestr)
      (if isdate 
        (do 
          (observe (levenshtein-abc-dist gendatestr 0.001) obsdatestr)
          {:isdate isdate :year year :month month :day day :locale locale})
        (do
          (observe (randomstring (count obsdatestr)) gendatestr)
          {:isdate isdate :year nil :month nil :day nil :locale nil})))))
